import React from 'react'
import search from '../img/search.png'

export default function Search() {
  return (
    <div className="search-bar">
      <div class="inner-search">
        <span ><img src={search} /></span>
        <input type="text" placeholder="Search" />
      </div>
    </div>
  )
}
